    false,nt"url": null,nt"notes": "This narrative report for National Elk
    Refuge outlines Refuge accomplishments from September through December of 1943.
    The report begins by summarizing the weather conditions, water conditions, and wildfires
    during this period. Wildlife- including migratory birds, big game animals, and furbearers-
    is also covered. The Refuge development and maintenance section discusses physical
    developments and plantings. The public relations section discusses Refuge visitors
